import React, { createContext } from 'react';
export const KeplerUIContext = createContext(null);
export const WithKeplerUI = KeplerUIContext.Consumer;
export const InjectKeplerUI = ({ children, keplerUI }) => React.createElement(KeplerUIContext.Provider, { value: keplerUI }, children);
export const injectKeplerUI = (Component, keplerUI) => props => (React.createElement(KeplerUIContext.Provider, { value: keplerUI },
    React.createElement(Component, { ...props })));
